const Index = () => {
    return (
        <div>
            <div className="bg-gray-200 py-4">
                <h1>
                    <img src="/logo.png" alt="Bem vindo" className='h-24'/> 
                    Olá Lucas.
                </h1>
            </div>	
        </div>
        
        
        
    );
}

export default Index;
